public class ass3 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int a = 10;
		int b = 20;
		
		System.out.println("before swap");
		System.out.println("a = " +a);
		System.out.println("b = " +b);
		
		int c = a;
		
		a = b;
		
		b = c;
		System.out.println("after swap");
		System.out.println("a = " +a);
		System.out.println("b = " +b);

	}

}
